import React, { Component } from 'react'


class Home extends Component{

  componentDidMount(){
    if (localStorage.length > 0) {
      fetch("http://localhost:3000/profile", {
      headers: {
        Authorization: localStorage.token
      }
    })
    .then(res => res.json())
    .then(userObject => {
      // debugger
      console.log(userObject)
    })
    }

  }
  render() {
    return (
    <div>Home Page</div>
    )
     }
 }

export default Home
